<html>
<head>
    <meta charset="utf-8">
    <link href="./nv.d3.min.css" rel="stylesheet" type="text/css">

    <meta name="viewport" content="width=device-width, initial-scale=1, minimum-scale=1, maximum-scale=1, user-scalable=no">

    <style>
        text {
            font: 12px sans-serif;
        }
        svg {
            display: block;
        }
        html, body, #chart1, svg {
            margin: 0px;
            padding: 0px;
            height: 100%;
            width: 100%;
        }
        * {
           -webkit-tap-highlight-color: rgba(0,0,0,0);
           -webkit-touch-callout: none;
        }
    </style>
</head>
<body>
    
<div id="chart1" class='with-transitions'>
    <svg></svg>
</div>

<script>
    // Prevent context menu
    d3.select("body").on("contextmenu", function() {
        window.webkit.messageHandlers.context.postMessage({});
        d3.event.preventDefault();
    });
    
    var iOS = navigator.userAgent.indexOf("Mobile") > -1;
    var chart = nv.models.lineChart();
    chart.margin({top: 20, bottom:40, left:50, right:50});
    chart.x(function(d) { var v = d[0]; return v; });
    chart.y(function(d) { var v = d[1]; return v;  });
    chart.xScale(d3.time.scale());
    chart.forceY(0);

    chart.useInteractiveGuideline(true);
    var ll = navigator.language.toLowerCase();
    var mdy = { "en-us" : true }
    if (ll in mdy) {
        chart.xAxis.tickFormat(function(d) { return d3.time.format('%m/%d')(new Date(d)); });
    } else {
        chart.xAxis.tickFormat(function(d) { return d3.time.format('%d/%m')(new Date(d)); });
    }
    chart.yAxis.tickFormat(d3.format('d'));
    
    chart.showLegend(false);
    
    var data = { intervals: [] };
    
    function loadChart() {    
        var chartKVs = null;
        if ("partitions" in data) {
            if (chart._ship_currentData) {
                previouslyDisabled = new Set(chart._ship_currentData.filter(function(s) {
                    return !!(s.disabled)
                }).map(function(s) {
                    return s.key;
                }));
            } else {
                var previouslyDisabled = new Set();
            }
            chartKVs = data.partitions.map(function(p) {
                return { 
                    key : p.key, 
                    values : p.intervals.map(function(i) { 
                        return [i.startDate, i.count]; 
                    }),
                    disabled: previouslyDisabled.has(p.key)
                };
            });
            chart.showLegend(true);
            d3.select(".nv-legend").style("display", "")
        } else {
            chartKVs = [ { key : "Item Count", area : true, values : data.intervals.map(function(i) { return [i.startDate, i.count]; }) } ];
            chart.showLegend(false);
            d3.select(".nv-legend").style("display", "none")
        }
    
        chart._ship_currentData = chartKVs;
    
        d3.select('#chart1 svg')
            .datum(chartKVs)
            .call(chart);

        nv.utils.windowResize(function() {
            var oldDuration = chart.duration();
            chart.duration(0);
            chart.update();
            chart.duration(oldDuration);
        });

        return chart;
    }
    
    nv.addGraph(loadChart, afterLoad);
    
    function updateChart(d) {
        data = d;
        loadChart();
        
        d3.selectAll('.nv-x text')
            .style("pointer-events", "visiblePainted")
            .style("cursor", "default")
            .on("dblclick", function() {
                window.webkit.messageHandlers.configure.postMessage({});
            });
    }

    function resizeChart() {
        var oldDuration = chart.duration();
        chart.duration(0);
        if (iOS) {
            var insets;
            if (window.innerWidth < 420.0) {
                insets = {top: 20, bottom:35, left:40, right:25};
            } else {
                insets = {top: 20, bottom:35, left:50, right:40};
            }
            chart.margin(insets);
        }
        chart.update();
        chart.duration(oldDuration);
    }

    if (iOS) {
        resizeChart();
    }
